import React, { useState, useEffect } from 'react';
import { NavLink } from 'react-router-dom'; 
import './Navbar.css';

const Navbar = () => {
    const [isOpen, setIsOpen] = useState(false);

    const openNav = () => {
        setIsOpen(true);
    };

    const closeNav = () => {
        setIsOpen(false);
    };

    const handleClickOutside = (event) => {
        if (isOpen && !document.querySelector('.sidenav').contains(event.target)) {
            closeNav();
        }
    };

    useEffect(() => {
        document.addEventListener('mousedown', handleClickOutside);
        return () => {
            document.removeEventListener('mousedown', handleClickOutside);
        };
    }, [isOpen]);

    return (
        <div>
            <nav className="topnav"> 
                <div style={{ textAlign: 'center' }}>
                    <NavLink className="topnav-link" aria-current="page" to="/products">
                        <strong>Levents Vacation Dream 2024</strong>
                    </NavLink>
                </div>
            </nav>
            <div className={`sidenav ${isOpen ? 'open' : ''}`}>
                <ul className="navbar-nav">
                    <li className="nav-item">
                        <NavLink className="nav-link" aria-current="page" to="/collections/classic-line" onClick={closeNav}>LEVETS® CLASSIC</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" aria-current="page" to="/" onClick={closeNav}>HOME</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/about" onClick={closeNav}>ABOUT</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/contact" onClick={closeNav}>CONTACT</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/collections/new-arrival" onClick={closeNav}>NEW ARRIVAL</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/products" onClick={closeNav}>ALL PRODUCTS</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/tops" onClick={closeNav}>TOPS</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/bottoms" onClick={closeNav}>BOTTOMS</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/outerwear" onClick={closeNav}>OUTERWEAR</NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/accessories" onClick={closeNav}>ACCESSORIES</NavLink>
                    </li>
                </ul>
            </div>
            <nav className="navmenu">
                <span onClick={openNav}>
                    <svg width="30" height="30" id="icoOpen">
                        <path d="M0,5 30,5" stroke="#000" strokeWidth="1" />
                        <path d="M0,14 30,14" stroke="#000" strokeWidth="1" />
                        <path d="M0,23 30,23" stroke="#000" strokeWidth="1" />
                    </svg>
                </span>
            </nav>
        </div>
    );
};

export default Navbar;
